(74, 'faq.element', '{\"question\":\"CAN EVERYONE JOIN?\",\"answer\":\"Yes we accept everyone from all countries but you must be of legal age in your country to participate in this program, and in all the cases your minimal age must be 18 years.\"}', '2020-12-01 01:25:16', '2022-02-16 02:32:38'),
(75, 'faq.element', '{\"question\":\"HOW DO I JOIN?\",\"answer\":\"Click the Signup link in the navigation and fill out the short form there Its best to use a Gmail account when you sign up. Make Sure to Provide a Valid Email address during the signup.\\r\\nMake Sure you are joining under your sponsor.\"}', '2020-12-01 01:25:21', '2022-02-16 02:33:46'),
