(77, 'faq.element', '{\"question\":\"HOW CAN I EARN WITH LAEI?\",\"answer\":\"We offer multiple streams of revenue generation which includes:\\r\\n1. Multiple Follow Me Phases\\r\\n2. Binary Pairing System\\r\\n3. Straight Line System\\r\\n4. Direct Sponsoring Bonus\\r\\n5. Paid to Click (Ptc)\\r\\n6. Learn and Earn International Revenue Sharing System\"}', '2020-12-01 01:25:33', '2022-02-16 02:34:37'),
