(96, 'faq.element', '{\"question\":\"CAN I JOIN AS A FREE MEMBER?\",\"answer\":\"Yes you can but keep in mind;  If you sign up as a free member and recruit referrals that upgrade they will be passed up to your sponsor. This will keep happening till you upgrade your account so it\\u2019s smart to upgrade your account as soon as possible.\"}', '2022-02-16 02:37:33', '2022-02-16 02:37:36'),
(97, 'faq.element', '{\"question\":\"WHICH PAYMENT PROCESSORS DO YOU ACCEPT?\",\"answer\":\"At the moment we only accept Payza, Liberty Reserve, Perfect Money and Solid Trust Pay but it\'s possible we\'ll add more in the future.\"}', '2022-02-16 02:37:55', '2022-02-16 02:37:55'),
(98, 'faq.element', '{\"question\":\"I UNDERSTAND THERE\\u2019S SOME ADVERTISING INCLUDED WHEN I BUY AN UPGRADE?\",\"answer\":\"Yes that\\u2019s correct. Every Upgrade you buy is actually a purchase of advertising so that makes this system 100% legal. For every upgrade you\\u2019ll receive advertising credits.\\r\\n\\r\\nYou can use these credits on our site for banner ads and\\/or text ads to promote your program, business or whatever you want to promote as long as it\\u2019s no porn, hatred or racist content\"}', '2022-02-16 02:38:14', '2022-02-16 02:38:14'),
(99, 'faq.element', '{\"question\":\"DO I NEED TO RECRUIT REFERRALS TO EARN?\",\"answer\":\"we offer booth type of system active as well as passive, some of them involved sponsoring of new members to earn like\\r\\na) Follow Me Phases System\\r\\nb) Binary System\"}', '2022-02-16 02:38:32', '2022-02-16 02:38:32'),
(100, 'faq.element', '{\"question\":\"HOW CAN I USE THE E-WALLET  FEATURE?\",\"answer\":\"You can use it in multiple ways. Just to transfer funds from your account to the account of another member. Or you can use it to pool funds to buy positions in the higher lines\\/Phases together and when those positions cycle you can distribute the profit to the members that participated. It\\u2019s a very powerful feature to maximize your earnings in our program.\"}', '2022-02-16 02:39:03', '2022-02-16 02:39:04'),
(101, 'faq.element', '{\"question\":\"WHAT IS YOUR MINIMUM WITHDRAWAL AMOUNT?\",\"answer\":\"The minimum amount you can withdraw is $6 and maximum amount is $1000.\"}', '2022-02-16 02:39:18', '2022-02-16 02:39:20'),
(102, 'faq.element', '{\"question\":\"AFTER I MAKE A WITHDRAWAL REQUEST, HOW LONG DOES IT TAKE TO PROCESS?\",\"answer\":\"We process withdrawal requests daily but allow max 48 hours for funds to be available in your account.\"}', '2022-02-16 02:39:33', '2022-02-16 02:39:35'),
(103, 'faq.element', '{\"question\":\"CAN I GET A REFUND?\",\"answer\":\"Please understand that you are purchasing our product  (Ad credits) and this is made available to you instantly by our system. AS such, we do not offer any refund. Please read and agree to our terms and conditions before you purchasing\\/Upgrading. If you do not agree, please do not purchase.\"}', '2022-02-16 02:39:55', '2022-02-16 02:39:55'),
(104, 'faq.element', '{\"question\":\"Can I change My Sponsor?\",\"answer\":\"Due to complex nature of the system changing one\'s sponsor is not possible. When joining our site make you are joining under correct sponsor user name.\"}', '2022-02-16 02:40:25', '2022-02-16 02:40:26'),
(105, 'faq.element', '{\"question\":\"How Much ad credits do I get per ad $20 position?\",\"answer\":\"For every $20.00 position, you will receive 10,000 Ad Credits.\\r\\n\\r\\nYou can use these credits on our site for banner ads (125x125 banners and 468x60 banners) and\\/or text ads to promote your program, business or whatever you want to promote as long as it\'s no porn, hatred or racist content.\"}', '2022-02-16 02:40:43', '2022-02-16 02:40:43'),
(106, 'faq.element', '{\"question\":\"How I can Buy Cycler Spot?\",\"answer\":\"You can follow these steps\\r\\n\\r\\n\\u00b7         Login to your member area\\r\\n\\r\\n\\u00b7         Click the link \\u201cPurchase Cycler Spot\\u201d in the left menu\\r\\n\\r\\n\\u00b7         Select the Line in which you want to purchase by\\r\\n \\r\\n\\r\\n  selecting\\/checking the radio box and submit the form\\r\\n\\r\\n\\u00b7         Select the number of spots you want to purchase (1-2) spots in a\\r\\n \\r\\n\\r\\n  single transaction and chose the payment method.\\r\\n\\r\\n \\r\\n\\r\\nYou can Purchase spot in any line you want using\\r\\n\\r\\n1.      Your Repurchase Balance\\r\\n\\r\\n2.      Your E-Wallet Balance\\r\\n\\r\\n3.      Your Cash Balance\\r\\n\\r\\n4.      Using available Payment Processor\\r\\n\\r\\n \\r\\n\\r\\n(Re-Purchase balance can only be used to buy 1 spot in $5 line)\"}', '2022-02-16 02:40:59', '2022-02-16 02:41:00'),
(107, 'faq.element', '{\"question\":\"When will a Cycler spot cycles?\",\"answer\":\"A spot start cycling when it reaches at the top of\\r\\nthat line.\\r\\n \\r\\n\\r\\nOn each cycles earning will be pool into that spot.\\r\\n \\r\\n\\r\\nOnce spot matured i.e. earn 300% earning will be added\\r\\nto your cash account\\r\\n \\r\\n\\r\\nAnd spot will move into next line if applicable.\\r\\n\\r\\n(When spot cycles it earns 300%, out of that 200% will be use to\\r\\nbuy spot in next line and 100% will be added to your cash balance.\\r\\nIn last Line ($2,500) full 300% will be added to your account.)\\r\\n\\r\\nA spot start cycling when it reaches at the top of\\r\\nthat line.\\r\\n \\r\\n\\r\\nOn each cycles earning will be pool into that spot.\\r\\n \\r\\n\\r\\nOnce spot matured i.e. earn 300% earning will be added\\r\\nto your cash account\\r\\n \\r\\n\\r\\nAnd spot will move into next line if applicable.\\r\\n\\r\\n(When spot cycles it earns 300%, out of that 200% will be use to\\r\\nbuy spot in next line and 100% will be added to your cash balance.\\r\\nIn last Line ($2,500) full 300% will be added to your account.)\"}', '2022-02-16 02:41:16', '2022-02-16 02:41:18'),
(108, 'faq.element', '{\"question\":\"What is download link?\",\"answer\":\"Download section will help you to increase your skills and knowledge.\\r\\n \\r\\nWhich will ultimately help you earn more and more on daily basis.\\r\\n \\r\\nTutorials will be able in pdf and cd formats.\\r\\n\\r\\nAmount is very lowest and will get you earn more.\"}', '2022-02-16 02:41:39', '2022-02-16 02:41:40'),
(109, 'faq.element', '{\"question\":\"How is download section works?\",\"answer\":\"When you download pdf or download section you can get download from the \\\"My Downloads\\\" section.\\r\\n Referral will get bonus on each download.\"}', '2022-02-16 02:42:51', '2022-02-16 02:42:51');
